import React from 'react';
import './Create.css'; // Make sure the CSS file is named correctly and imported
import kilter_board from '../public/kilter_board.png';

function Create() {
  return (
    <main className="create-route">
      <h1>Climbology</h1>
      <div className="content-area">
          <img src={kilter_board} alt="kilter board image" className="kilter-board" />
      </div>
    </main>
  );
}

export default Create;
